--
-- Table structure for table `purchase`
--

DROP TABLE IF EXISTS `purchase`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `purchase` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user` bigint(20) NOT NULL,
  `shop` bigint(20) NOT NULL,
  `status` int(1) NOT NULL,
  `item_amount` double NOT NULL,
  `shipping_amount` double NOT NULL,
  `total_amount` double NOT NULL,
  `currency` varchar(3) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` datetime NOT NULL,
  `paypal_uid` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `response` longtext COLLATE utf8_unicode_ci,
  `items_count` int(11) NOT NULL,
  `address` bigint(20) NOT NULL,
  `shipping_status` int(1) NOT NULL DEFAULT '0',
  `tracking` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `shipping_company` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `pay_method` tinyint(1) NOT NULL DEFAULT '1',
  `note` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`id`),
  UNIQUE KEY `paypal_uid` (`paypal_uid`),
  KEY `user` (`user`),
  KEY `shop` (`shop`),
  KEY `address` (`address`),
  CONSTRAINT `purchase_ibfk_1` FOREIGN KEY (`user`) REFERENCES `users` (`user_id`),
  CONSTRAINT `purchase_ibfk_2` FOREIGN KEY (`shop`) REFERENCES `shops` (`shop_id`),
  CONSTRAINT `purchase_ibfk_3` FOREIGN KEY (`address`) REFERENCES `purchase_address` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

