INSERT INTO `shops` VALUES (40,59,323,324,'2014-03-26 09:58:22','2014-04-01 08:22:50','Swarajshop',NULL,'Payment Method: You shall pay the Transaction Price through the available methods of payment i.e. Payment on Billing or Payment on Delivery, for the Transactions conducted on the Website. You will be intimated when (i) the Transaction Price is credited to the account of the Company (in case of Payment on Billing) or (ii) on committing to pay the Transaction Price on Delivery if you opt for Payment on Delivery payment method, which will be confirmed by the Website. The Website shall notify the Buyer upon Payment Confirmation as provided herein.\r\n\r\nNon-payment: Buyers are not permitted to buy any product without making a payment of the Transaction Price by Payment on Billing method of opting for Payment on Delivery or such other payment method provided by the Company on the Website, in respect of the product as described in the listing.',NULL,NULL,'Swarajshop Global Pvt. Ltds main aim is to become the leading Online Handicrafts Company by creating an Indian global brand allowing designers, artisans and small businesses to connect with customers and bring products that enhance ones life. This simply means having in place unique and efficient online marketing facilities, strategies and the appropriate human resources. Having this as the companys main target, Swarajshop Global Pvt. Ltd is investing in numerous ways that will make the company stand out among other Online Handicrafts companies in India and the world at large.\r\n\r\nSwarajshop Global, an incorporation that is founded by Mangesh Shinde, a veteran with several years of working experience as an online entrepreneur in the industry. The companys main focus will be based on consistent improvement process of setting goals, measuring results, development processes and giving the necessary feedback to stakeholders in order to speed up the level of growth and development.',NULL,0,1,0,14,58,'a:1:{i:0;s:1:\"2\";}','ganeshbehera2011ss@gmail.com',NULL,'USD',0,NULL,0,15,0,NULL,NULL,NULL,'a:1:{i:0;s:0:\"\";}',0,0,1),(41,62,335,336,'2014-04-14 13:55:06','2014-06-25 20:11:19','My Shop','Buy Online Shop','Not Re','Hdhhd','kkkdkdkdk','Manufatures',NULL,0,1,0,2,30,NULL,'swarajsankalpindia@gmail.com',NULL,'USD',0,NULL,0,15,0,NULL,NULL,NULL,'a:1:{i:0;s:35:\"https://www.facebook.com/swarajshop\";}',0,0,1);
